import React, { useState } from "react";

export default function RegistroDiario({ onBack }) {
  const [diario, setDiario] = useState({
    fecha: new Date().toLocaleDateString(),
    aprendizajes: "",
    emociones: "",
    respetoPlan: "",
    mejoras: "",
  });

  const [registros, setRegistros] = useState([]);

  const handleChange = (e) => {
    setDiario({ ...diario, [e.target.name]: e.target.value });
  };

  const handleGuardar = () => {
    if (!diario.aprendizajes || !diario.respetoPlan) {
      alert("Por favor completa al menos los campos principales.");
      return;
    }

    setRegistros([diario, ...registros]);

    // Resetear
    setDiario({
      fecha: new Date().toLocaleDateString(),
      aprendizajes: "",
      emociones: "",
      respetoPlan: "",
      mejoras: "",
    });
  };

  return (
    <div className="min-h-screen bg-black text-white p-6">
      <div className="max-w-4xl mx-auto">
        <button onClick={onBack} className="text-indigo-400 hover:underline mb-6 text-sm">
          ← Volver al Dashboard
        </button>

        <h1 className="text-3xl font-bold text-indigo-400 mb-6">📝 Registro Diario</h1>

        <div className="space-y-4 mb-8">
          <div>
            <label className="block text-sm mb-1 text-gray-300">¿Qué aprendiste hoy?</label>
            <textarea
              name="aprendizajes"
              value={diario.aprendizajes}
              onChange={handleChange}
              className="w-full p-3 rounded bg-gray-800 border border-gray-700"
              rows="3"
              placeholder="Describe lo aprendido hoy en tu operativa o psicología..."
            />
          </div>

          <div>
            <label className="block text-sm mb-1 text-gray-300">¿Qué emociones dominaste hoy?</label>
            <input
              name="emociones"
              value={diario.emociones}
              onChange={handleChange}
              className="w-full p-2 rounded bg-gray-800 border border-gray-700"
              placeholder="Ej: ansiedad, calma, confianza, miedo..."
            />
          </div>

          <div>
            <label className="block text-sm mb-1 text-gray-300">¿Respetaste tu plan de trading?</label>
            <select
              name="respetoPlan"
              value={diario.respetoPlan}
              onChange={handleChange}
              className="w-full p-2 rounded bg-gray-800 border border-gray-700"
            >
              <option value="">Selecciona una opción</option>
              <option value="Sí">Sí</option>
              <option value="Parcialmente">Parcialmente</option>
              <option value="No">No</option>
            </select>
          </div>

          <div>
            <label className="block text-sm mb-1 text-gray-300">¿Qué mejorarías mañana?</label>
            <input
              name="mejoras"
              value={diario.mejoras}
              onChange={handleChange}
              className="w-full p-2 rounded bg-gray-800 border border-gray-700"
              placeholder="Ej: entrar con más convicción, esperar confirmaciones, etc."
            />
          </div>
        </div>

        <button
          onClick={handleGuardar}
          className="bg-indigo-600 hover:bg-indigo-700 text-white py-2 px-6 rounded mb-6"
        >
          Guardar Registro
        </button>

        <div className="bg-gray-900 p-4 rounded-xl border border-gray-700">
          <h2 className="text-xl font-semibold text-indigo-300 mb-4">📚 Historial de Registros</h2>
          {registros.length === 0 ? (
            <p className="text-gray-500">Aún no has registrado nada.</p>
          ) : (
            <div className="space-y-4 max-h-80 overflow-y-auto">
              {registros.map((r, i) => (
                <div key={i} className="bg-gray-800 p-3 rounded border border-gray-700">
                  <p className="text-sm text-gray-400 mb-2">🗓️ {r.fecha}</p>
                  <p><strong>Aprendizajes:</strong> {r.aprendizajes}</p>
                  <p><strong>Emociones:</strong> {r.emociones}</p>
                  <p><strong>¿Respetó su plan?:</strong> {r.respetoPlan}</p>
                  <p><strong>Mejoras para mañana:</strong> {r.mejoras}</p>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}
